import { TimeFilter } from '../components/ChartFilters';

export interface ChartDataPoint {
  date: string;
  value: number;
  label?: string;
}

export interface MultiPlatformDataPoint {
  date: string;
  threads: number;
  instagram: number;
  youtube: number;
}

export const generateTimeFilteredData = (
  baseData: any[],
  filter: TimeFilter,
  currentValue: number
): any[] => {
  const now = new Date();
  let dataPoints: any[] = [];

  switch (filter) {
    case '7d':
      // Last 7 days
      for (let i = 6; i >= 0; i--) {
        const date = new Date(now.getFullYear(), now.getMonth(), now.getDate() - i);
        dataPoints.push({
          date: date.toLocaleDateString('en-US', { month: 'short', day: 'numeric' }),
          value: Math.round(currentValue * (0.8 + (i * 0.03))),
          fullDate: date.toISOString().split('T')[0],
        });
      }
      break;

    case '30d':
      // Last 30 days (weekly averages)
      for (let i = 4; i >= 0; i--) {
        const date = new Date(now.getFullYear(), now.getMonth(), now.getDate() - (i * 7));
        dataPoints.push({
          date: `Week ${5 - i}`,
          value: Math.round(currentValue * (0.7 + (i * 0.06))),
          fullDate: date.toISOString().split('T')[0],
        });
      }
      break;

    case '3m':
      // Last 3 months
      for (let i = 2; i >= 0; i--) {
        const date = new Date(now.getFullYear(), now.getMonth() - i, 1);
        dataPoints.push({
          date: date.toLocaleDateString('en-US', { month: 'short' }),
          value: Math.round(currentValue * (0.8 + (i * 0.1))),
          fullDate: date.toISOString().split('T')[0],
        });
      }
      break;

    case '6m':
      // Last 6 months
      for (let i = 5; i >= 0; i--) {
        const date = new Date(now.getFullYear(), now.getMonth() - i, 1);
        dataPoints.push({
          date: date.toLocaleDateString('en-US', { month: 'short' }),
          value: Math.round(currentValue * (0.7 + (i * 0.05))),
          fullDate: date.toISOString().split('T')[0],
        });
      }
      break;

    case '1y':
      // Last 12 months (quarterly)
      for (let i = 3; i >= 0; i--) {
        const date = new Date(now.getFullYear(), now.getMonth() - (i * 3), 1);
        dataPoints.push({
          date: `Q${4 - i}`,
          value: Math.round(currentValue * (0.6 + (i * 0.1))),
          fullDate: date.toISOString().split('T')[0],
        });
      }
      break;

    case 'all':
    default:
      // Use the original data
      dataPoints = baseData;
      break;
  }

  return dataPoints;
};

export const generateMultiPlatformData = (
  filter: TimeFilter,
  youtubeValue: number,
  threadsValue: number = 48500,
  instagramValue: number = 71200
): MultiPlatformDataPoint[] => {
  const now = new Date();
  let dataPoints: MultiPlatformDataPoint[] = [];

  switch (filter) {
    case '7d':
      // Last 7 days
      for (let i = 6; i >= 0; i--) {
        const date = new Date(now.getFullYear(), now.getMonth(), now.getDate() - i);
        dataPoints.push({
          date: date.toLocaleDateString('en-US', { month: 'short', day: 'numeric' }),
          threads: Math.round(threadsValue * (0.8 + (i * 0.03))),
          instagram: Math.round(instagramValue * (0.8 + (i * 0.03))),
          youtube: Math.round(youtubeValue * (0.8 + (i * 0.03))),
        });
      }
      break;

    case '30d':
      // Last 30 days (weekly averages)
      for (let i = 4; i >= 0; i--) {
        dataPoints.push({
          date: `Week ${5 - i}`,
          threads: Math.round(threadsValue * (0.7 + (i * 0.06))),
          instagram: Math.round(instagramValue * (0.7 + (i * 0.06))),
          youtube: Math.round(youtubeValue * (0.7 + (i * 0.06))),
        });
      }
      break;

    case '3m':
      // Last 3 months
      for (let i = 2; i >= 0; i--) {
        const date = new Date(now.getFullYear(), now.getMonth() - i, 1);
        dataPoints.push({
          date: date.toLocaleDateString('en-US', { month: 'short' }),
          threads: Math.round(threadsValue * (0.8 + (i * 0.1))),
          instagram: Math.round(instagramValue * (0.8 + (i * 0.1))),
          youtube: Math.round(youtubeValue * (0.8 + (i * 0.1))),
        });
      }
      break;

    case '6m':
      // Last 6 months
      for (let i = 5; i >= 0; i--) {
        const date = new Date(now.getFullYear(), now.getMonth() - i, 1);
        dataPoints.push({
          date: date.toLocaleDateString('en-US', { month: 'short' }),
          threads: Math.round(threadsValue * (0.7 + (i * 0.05))),
          instagram: Math.round(instagramValue * (0.7 + (i * 0.05))),
          youtube: Math.round(youtubeValue * (0.7 + (i * 0.05))),
        });
      }
      break;

    case '1y':
      // Last 12 months (quarterly)
      for (let i = 3; i >= 0; i--) {
        dataPoints.push({
          date: `Q${4 - i}`,
          threads: Math.round(threadsValue * (0.6 + (i * 0.1))),
          instagram: Math.round(instagramValue * (0.6 + (i * 0.1))),
          youtube: Math.round(youtubeValue * (0.6 + (i * 0.1))),
        });
      }
      break;

    case 'all':
    default:
      // Use 6 months as default for "all time"
      for (let i = 5; i >= 0; i--) {
        const date = new Date(now.getFullYear(), now.getMonth() - i, 1);
        dataPoints.push({
          date: date.toLocaleDateString('en-US', { month: 'short' }),
          threads: Math.round(threadsValue * (0.7 + (i * 0.05))),
          instagram: Math.round(instagramValue * (0.7 + (i * 0.05))),
          youtube: Math.round(youtubeValue * (0.7 + (i * 0.05))),
        });
      }
      break;
  }

  return dataPoints;
};
